import CartItem from './CartItem';
import Modal from '../UI/Modal';
import Card from '../UI/Card';
const Cart = () =>{
	 const cartItems= [{id:'34', name:'bhonta', numbers:'3',price:'$24.55'}].map(m=>{
		return(
		<CartItem
		id={m.id}
		name={m.name}
		number={m.numbers}
		price={m.price}
		/>

	)})
	return(
		<Card>

       <Modal>
		{cartItems}
		</Modal>
		</Card>
	)
}
export default Cart;
